utils:
function numberFormatter(params) {
    if (typeof params.value === 'number') {
        return params.value.toFixed(2);
    }
    return params.value;
}

onGridReady:
{
    const mockServer = createMockServer(), initialLoad$ = mockServer.initialLoad(), updates$ = mockServer.allDataUpdates();
    initialLoad$.subscribe(function (rowData) {
        params.api.setRowData(rowData);
        updates$.subscribe(function (newRowData) {
            return params.api.setRowData(newRowData);
        });
    });
}
